import React from 'react'
import styled, { keyframes } from "styled-components"
// import keyframes from "styled-components"

const Animate = keyframes`
    from {
        margin-top: 15px;
        opacity: 0.7;
      }

      50% {
        margin-top: 15px;
        opacity: 0.7;
      }

      52% {
        margin-top: 15px;
        opacity: 0.9;
      }

      60% {
        margin-top: 4px;
        opacity: 1;
      }

      65% {
        margin-top: 15px;
        opacity: 0.9;
      }

      70% {
        margin-top: 15px;
        opacity: 0.7;
      }

      75% {
        margin-top: 15px;
      }

      to {
        margin-top: 15px;
      }
}
`

const Border = styled.div`
    height: 30px;
    width: 16px;
    border: 2px solid #D9DFED;
    border-radius: 16px;
    // background-color: red;
`

const Wheel = styled.div`
    border: 2px solid #D9DFED;
    border-radius: 16px;
    height: 8px;
    width: 2px;
    margin-top: 15px;
    margin-left: 5px;
    background-color: #D9DFED99;
    animation: ${Animate} 6s ease-in-out infinite;
    opacity: 0.7;
`

export default function Scroll () {
    return (
        <Border>
            <Wheel></Wheel>
        </Border>
    )
}
